import React from "react";
import "./Join.css";

const Join = () => {
	return (
		<div className="Join" id="join-us">
			<div className="left-j">
				<div>
					<span className="stroke-text">READY TO </span>
					<span> LEVEL UP</span>
				</div>
				<div>
					<span>YOUR BODY</span>
					<span className="stroke-text"> WITH US?</span>
				</div>
			</div>
			<div className="right-j"></div>
		</div>
	);
};

export default Join;
